		["quests"] = {
			[35819] = {
				["reward_text"] = "The Laughing Skull have always steered clear of that area because Khargax was very quick for such a huge beast. They will be pleased to know their eaten dead have been avenged.",
				["can_share"] = true,
				["end"] = {
					["NPC:74594"] = true,
				},
			},
			[32783] = {
				["reward_text"] = "So my brother would not dare come himself?",
				["can_share"] = true,
				["end"] = {
					["VEHICLE:70909"] = true,
				},
			},
			[32791] = {
				["reward_text"] = "The Thunderlord think their numbers will save them.\n\nWe will show them that their numbers count for nothing when hunted by a pack of Frostwolves.",
				["can_share"] = true,
				["end"] = {
					["NPC:74000"] = true,
				},
			},
			[35102] = {
				["reward_text"] = "We have a lot of basic arms here but I'll get them improved in no time.\n\nThanks for giving me this chance.",
				["end"] = {
					["NPC:79356"] = true,
				},
			},
			[34345] = {
				["reward_text"] = "Haha! Ya brought 'em! I hope ya not offended I asked such a lowly task of ya. We needed the leaves, and I needed to settle a bet.",
				["can_share"] = true,
				["progress_text"] = "I'd pick de flowers myself, but I <name> allergies. Ha ha!",
				["end"] = {
					["NPC:78208"] = true,
				},
			},
			[34106] = {
				["reward_text"] = "I knew you'd kill her. No Iron Horde is safe from your wrath.",
				["end"] = {
					["NPC:80833"] = true,
				},
			},
			[34656] = {
				["reward_text"] = "Who would expect to find these treasures draped over straw dolls, left to bake in the sun? Sometimes the best place to hide precious things is in plain sight.",
				["progress_text"] = "Wingblades forged in the name of a sun god to bring freedom and glory to her children.\n\nA mask worn by a great king who would walk among his people in disguise to know their true nature.",
				["can_share"] = true,
				["end"] = {
					["NPC:79519"] = true,
				},
			},
			[36226] = {
				["can_share"] = true,
			},
			[36273] = {
				["can_share"] = true,
			},
			[35668] = {
				["reward_text"] = "<Reshad gazes into the inky orb.>\n\nAmazing. To think Terokk used this very orb to commune with Anzu. One could become quite the darkweaver with an implement such as this.\n\nCome, let's get it safely to the Veil.",
				["can_share"] = true,
				["progress_text"] = "To hold such a treasure. I wonder if that Sun-Talon had any idea of the significance?",
				["end"] = {
					["NPC:81770"] = true,
				},
			},
			[34401] = {
				["reward_text"] = "This will do nicely, <name>. All we need now is a suitable crystal...",
				["progress_text"] = "Have you retrieved the arcane essence for me?",
				["can_share"] = true,
				["end"] = {
					["NPC:78515"] = true,
				},
			},
			[35429] = {
				["reward_text"] = "Ah... yes, yes, yes. Fresh pollen. With a dash of a few secret ingredients you can feed an army with the food you could grow from this, if you know the secret ways.",
				["can_share"] = true,
				["progress_text"] = "Few dare challenge the botani in the field of growing plants.",
				["end"] = {
					["NPC:82228"] = true,
				},
			},
			[32990] = {
				["reward_text"] = "You're back! But where is Karg?",
				["can_share"] = true,
				["end"] = {
					["NPC:72274"] = true,
				},
			},
			[33915] = {
				["can_share"] = true,
			},
			[35277] = {
				["reward_text"] = "Your will be done.\n\nFor the Horde!",
				["can_share"] = true,
				["end"] = {
					["NPC:81920"] = true,
				},
			},
			[34696] = {
				["reward_text"] = "We'll have to catch up later. We have bigger problems!",
				["end"] = {
					["NPC:75121"] = true,
				},
			},
			[35524] = {
				["reward_text"] = "You saw 'em burn off their own leaves? That'd be like me cutting off my cute-as-a-button pigtails!",
				["can_share"] = true,
				["end"] = {
					["NPC:82574"] = true,
				},
			},
			[33469] = {
				["reward_text"] = "Wolf Home is saved, but I sense a stronger enemy just over the horizon.",
				["can_share"] = true,
				["end"] = {
					["NPC:74272"] = true,
				},
			},
			[34465] = {
			},
			[34998] = {
				["can_share"] = true,
			},
			[33971] = {
				["can_share"] = true,
			},
			[35509] = {
				["reward_text"] = "The genesaur is coming!",
				["progress_text"] = "Kaz said she wants me to hide for this fight.",
				["end"] = {
					["NPC:82334"] = true,
				},
			},
			[36807] = {
			},
			[33740] = {
				["reward_text"] = "Their deaths will not bring back Aruuna, but it does give me comfort to know that some among us can stand against them.",
				["can_share"] = true,
				["end"] = {
					["NPC:75913"] = true,
				},
			},
			[33493] = {
				["reward_text"] = "Lokra has always lacked the patience and control of her older sister. She approaches problems head-first, and relies on her raw talents to succeed.\n\nSeeing the way her and Karg look at each other, I am not surprised she chased him all the way to Grom'gar. What surprises me is that they made it back.\n\nAs usual, I expect we have you to thank for that. You continue to honor us with your deeds.",
				["can_share"] = true,
				["end"] = {
					["NPC:74163"] = true,
				},
			},
			[32991] = {
				["reward_text"] = "Thank you for finding the others. Karg and his captor are one step ahead of us, but they're limping.",
				["can_share"] = true,
				["end"] = {
					["NPC:72274"] = true,
				},
			},
			[36864] = {
				["reward_text"] = "I can honestly say I never thought I'd see the premier Horde commander walking through an Alliance garrison.\n\nThen again, I never thought I'd be caught while performing reconnaissance for the Dark Lady and stuffed in a hole in the ground left for dead.\n\nI'm clearly not going anywhere without your help. If you help me out of this hellhole, I'll serve under your banner. My solo run has been decidedly less than pleasant.",
				["end"] = {
					["NPC:86597"] = true,
				},
			},
			[35557] = {
				["reward_text"] = "Gorgrond is no place for armies, Commander. We are now stepping into the domain of legends.",
				["end"] = {
					["NPC:74594"] = true,
				},
			},
			[37014] = {
				["progress_text"] = "<The power crystal for this unit has been disconnected. Whatever did this also managed to rip out four of the other support modules. \n\nIf you found all of these items, you're confident you could restore it>",
			},
			[34075] = {
				["reward_text"] = "Thank you,<name>.\n\nI wish we could bring him back just to kill him again but I guess this will suffice.\n\nI hope the spirit of my little one will now know peace.",
				["can_share"] = true,
				["end"] = {
					["NPC:77210"] = true,
				},
			},
			[31752] = {
				["reward_text"] = "I am pleased to offer this gift to you, <race> <class>.  According to my calibrations, it will invoke feelings of enjoyment and gratitude.\n\nHave a nice day.",
				["end"] = {
					["NPC:43929"] = true,
				},
			},
			[34569] = {
				["reward_text"] = "You're the one in charge around here, right? I've heard the guards talk about your exploits and if I wasn't looking at you now I'd swear they were lying.\n\nI've only ever wanted to make the finest blades and put them in the hands of the strongest of fighters. I can tell already that you're exactly the type I want to carry my weapons.\n\nIf you can give me a chance I swear you will not be disappointed.",
				["end"] = {
					["NPC:79210"] = true,
				},
			},
			[34067] = {
				["reward_text"] = "Rope? Do you expect me to tie a noose and ask the Thunderlords to go hang themselves?\n\nWait... that gives me an idea. Yea, I think I can make this work with the right materials.\n\nGood Job.",
				["progress_text"] = "I'm growing tired of waiting, do you have anything to help our assault or not?",
				["can_share"] = true,
				["end"] = {
					["NPC:77210"] = true,
				},
			},
			[34840] = {
				["reward_text"] = "Now that we're inside we have much to do.",
				["end"] = {
					["NPC:80339"] = true,
				},
			},
			[33828] = {
				["reward_text"] = "The Iron Horde combines the strengths of every clan. We must continue looking for ways to sever those connections if we hope to defeat them.",
				["can_share"] = true,
				["progress_text"] = "Karg is right - this is our best opportunity to cripple Grom'gar's defenses. We do this, then we return to the clan, heads high with pride.",
				["end"] = {
					["NPC:72940"] = true,
				},
			},
			[34346] = {
				["reward_text"] = "Ah, now these be some fine trap making props. Ya know how to make a shadow huntah proud.",
				["can_share"] = true,
				["progress_text"] = "A shadow huntah knows much of da spirits. We be talkin'. We be tradin'. But these ice furies, dey be wicked,  boss-mon.",
				["end"] = {
					["NPC:78209"] = true,
				},
			},
			[34657] = {
				["reward_text"] = "Azik was right to guide you to me. If you were coming to help Skettis, we needed to meet.\n\nAnd if you were coming to attack us, well, I'd be dead either way, wouldn't I?\n\n<Reshad lets out a cawing laugh and stuffs another scroll into his robes.>\n\nThere, that's nearly everything.",
				["can_share"] = true,
				["end"] = {
					["NPC:79519"] = true,
				},
			},
			[34107] = {
				["reward_text"] = "Is that what I think it is? You are too kind, commander!",
				["progress_text"] = "Good to see you, commander.",
				["end"] = {
					["NPC:80833"] = true,
				},
			},
			[33661] = {
				["reward_text"] = "These are good strong hearts! You have done well <class> and I will hold my end of the bargain.",
				["can_share"] = true,
				["progress_text"] = "I will need those hearts <class>.",
				["end"] = {
					["NPC:82225"] = true,
				},
			},
			[34123] = {
				["reward_text"] = "I am glad to see you. Our clan has faced many challenges, but the sheer size of the army coming toward us is beyond anything we have attempted to face.\n\nWe need your experience.",
				["end"] = {
					["NPC:76487"] = true,
				},
			},
			[35406] = {
				["reward_text"] = "Seeds. So simple to look at but in each the potential for untold amounts of destruction. Much like my son.\n\nYou were wise to take these.",
				["progress_text"] = "What have you found?",
				["end"] = {
					["NPC:74606"] = true,
				},
			},
			[36434] = {
				["reward_text"] = "Ahh, there y'are!\n\nPenny Clobberbottom reportin' for duty, commander.",
				["end"] = {
					["NPC:85147"] = true,
				},
			},
			[35167] = {
				["can_share"] = true,
			},
			[35430] = {
				["reward_text"] = "The botani took my dad. They took my friends. And now they are making me eat fruit!\n\nWhy are they so mean?!\n\nDid you kill them all?\n\nI think you should kill them.",
				["can_share"] = true,
				["end"] = {
					["NPC:82254"] = true,
				},
			},
			[34418] = {
				["reward_text"] = "Your valor will give our men reprieve as they work to contain the threat completely. Well done.",
				["can_share"] = true,
				["end"] = {
					["NPC:75121"] = true,
				},
			},
			[34681] = {
				["reward_text"] = "Your will be done. I require your advisement, commander.",
				["can_share"] = true,
				["end"] = {
					["NPC:79176"] = true,
				},
			},
			[36474] = {
				["reward_text"] = "My husband sent you, didn't he?\n\nNormally I would laugh at that, but seeing these horrors, Kaz and I could use all the help we can get.",
				["end"] = {
					["NPC:74593"] = true,
				},
			},
			[36482] = {
				["reward_text"] = "Yay! Burn the bad guy! Burn him a lot!",
				["end"] = {
					["NPC:82274"] = true,
				},
			},
			[33685] = {
				["reward_text"] = "So that is why the saberon have barricaded themselves up there. They are good hunting <name>, and I want to get in there!\n\nI have an idea about that...",
				["can_share"] = true,
				["end"] = {
					["NPC:85089"] = true,
				},
			},
			[35707] = {
				["reward_text"] = "Hey! Looky what I found here.",
				["can_share"] = true,
				["end"] = {
					["NPC:82574"] = true,
				},
			},
			[37454] = {
				["progress_text"] = "Twice the cost of the last, but maybe that's worth the price. Or, perhaps a different currency would be more efficient for you?  I leave the choice up to you.\r\n\r\nRemember, you can only obtain three seals per week.  This counts as one of those three.  Next week, I may have others.",
			},
			[33454] = {
				["reward_text"] = "You have done the Frostwolf Clan a service, traveler. I shall be sure to tell Durotan of your deeds.",
				["can_share"] = true,
				["end"] = {
					["NPC:74635"] = true,
				},
			},
			[33660] = {
				["reward_text"] = "So they started storing their herbs in personal stashes instead of their storage dens, good to know.\n\nYou have helped me a great deal <name>.",
				["progress_text"] = "I need more reagents before I return to my brothers and sisters.",
				["end"] = {
					["NPC:82225"] = true,
				},
			},
			[33470] = {
				["reward_text"] = "This Iron Tide threatens to sweep over all of Draenor.\n\nThe pool has shown you a possible future. This vision of the Frostwolf clan's destruction must not be allowed to come to pass.\n\nYou must stop it, <name>.",
				["can_share"] = true,
				["end"] = {
					["NPC:74272"] = true,
				},
			},
			[35040] = {
				["reward_text"] = "Grulkor was crazy to think he could harness the power of those mushrooms, but then, most Laughing Skull are crazy.\n\nStill, not a complete waste of time.",
				["can_share"] = true,
				["end"] = {
					["NPC:82732"] = true,
				},
			},
			[35016] = {
				["reward_text"] = "This red slime covers everything, even the skulls of my hunters!  I'll make a Skulltaker of you yet though, great work!",
				["progress_text"] = "Afraid to get your hands dirty?  They are just bodies now, no need to be scared.",
				["can_share"] = true,
				["end"] = {
					["NPC:80757"] = true,
				},
			},
			[34400] = {
				["reward_text"] = "Thank you, <name>. These moths are typically peaceful creatures and are deserving of mercy.",
				["can_share"] = true,
				["end"] = {
					["NPC:78534"] = true,
				},
			},
			[32992] = {
				["reward_text"] = "<Lokra's gaze remains fixed on her dying frost wolf.>\n\nWe had them... We had them, Asha. You were so fast. So beautiful.\n\nI failed you, Asha. I am sorry.",
				["can_share"] = true,
				["end"] = {
					["NPC:72274"] = true,
				},
			},
			[35295] = {
				["reward_text"] = "Everyone be dead, mon. What did dis?",
				["can_share"] = true,
				["end"] = {
					["NPC:81961"] = true,
				},
			},
			[33580] = {
				["reward_text"] = "Mark my words, <race>: Aruuna and Veil Shadar were only the beginning.",
				["end"] = {
					["NPC:75288"] = true,
				},
			},
			[34577] = {
				["reward_text"] = "Good size chunks and without a lot of the matrix material on them.\n\nThese will do just fine.",
				["progress_text"] = "We need to get that ore before those damned goren eat it all.",
				["end"] = {
					["NPC:79356"] = true,
				},
			},
			[34855] = {
				["reward_text"] = "Now with the viziers gone the whole Gordunni enchantment trade with the Iron Horde will come crashing down!\n\nWe can now turn our attention to dealing with Morkurk.",
				["can_share"] = true,
				["end"] = {
					["NPC:80341"] = true,
				},
			},
			[35072] = {
			},
			[33955] = {
				["reward_text"] = "You startle the small pup.",
				["can_share"] = true,
				["end"] = {
					["NPC:76889"] = true,
				},
			},
			[35380] = {
				["reward_text"] = "If today was any other day I'd have you court-martialed for being out of uniform.",
				["can_share"] = true,
				["end"] = {
					["NPC:82194"] = true,
				},
			},
			[35096] = {
				["reward_text"] = "Commander <name>.\n\n<Uruk Foecleaver looks at you and grins.>\n\nTerms of surrender? Hmm... let me think.",
				["end"] = {
					["NPC:81086"] = true,
				},
			},
			[34124] = {
				["reward_text"] = "This was a costly victory, and a very painful lesson. We chose to refuse the Iron Horde and live as we always have, but I see now they will never respect such neutrality.\n\nI am not about to wait for the Iron Horde to martial their forces. We will fight with you, and bring the Iron Horde to its knees.\n\nCommander, the Frostwolves stand ready!",
				["end"] = {
					["NPC:76484"] = true,
				},
			},
			[33582] = {
				["reward_text"] = "Speaking of fortune, count yourself lucky that I was not among the defenders in Aruuna, for you'd have seen both ends of your guts before you laid eyes on the Fire-Sage.\n\nAh, sometimes I miss those days.\n\nHere is your coin.",
				["can_share"] = true,
				["end"] = {
					["NPC:75324"] = true,
				},
			},
			[33579] = {
				["reward_text"] = "I was worried my little act wouldn't fool you, but you played your role perfectly.\n\nIn fact, I would like to ask for your help again.",
				["end"] = {
					["NPC:75469"] = true,
				},
			},
			[34108] = {
				["reward_text"] = "Praise to <name>! For the Horde!",
				["progress_text"] = "If you decide to kill that creature, I will name my first-born in your honor.",
				["end"] = {
					["NPC:80833"] = true,
				},
			},
			[35611] = {
				["reward_text"] = "Thank you for returning to us, <name>. I must admit we are sorely in need of your help.",
				["can_share"] = true,
				["end"] = {
					["NPC:81770"] = true,
				},
			},
			[35399] = {
				["reward_text"] = "Dead? All dead? Dead and mulched and for<name>ten. No Chag with his missing nose or Meka with her love for chewing faces.\n\nAnd Torg, my beloved Torg. A son we had together. A son that is still missing.\n\nThe botani will pay for this. They will burn for this.",
				["can_share"] = true,
				["end"] = {
					["NPC:74606"] = true,
				},
			},
			[35407] = {
				["reward_text"] = "Well fought. For the Alliance!",
				["can_share"] = true,
				["end"] = {
					["NPC:82194"] = true,
				},
			},
			[35670] = {
				["can_share"] = true,
			},
			[34658] = {
				["reward_text"] = "Ah yes, there's my name at the top of the list. And a few Talonpriests from the Shadowglade as well.\n\nThey fear the return of Terokk, as they should.",
				["can_share"] = true,
				["progress_text"] = "<Reshad fastens another scroll to Percy, who squawks meekly in protest.>\n\nOh, stop whining.",
				["end"] = {
					["NPC:79519"] = true,
				},
			},
			[34073] = {
				["reward_text"] = "Good job <name>, I was able to use the commotion from your work to sneak into the camp.\n\nNow we have only one thing left to do.",
				["can_share"] = true,
				["end"] = {
					["NPC:77210"] = true,
				},
			},
			[35017] = {
				["reward_text"] = "Hah!  If he was that strong he'd still be alive.  Still it is good you did him honor.  Did you take his skull by any chance?",
				["can_share"] = true,
				["end"] = {
					["NPC:80757"] = true,
				},
			},
			[33917] = {
				["reward_text"] = "We can take it from here. Light's blessings to you, <class>.",
				["can_share"] = true,
				["end"] = {
					["NPC:78482"] = true,
				},
			},
			[35416] = {
				["reward_text"] = "Well done, Commander. Many of the orcs have tried to master the power of the genesaur but I have never heard of any succeeding.\n\nYou have won us a powerful weapon for the next time we face the Iron Horde.",
				["end"] = {
					["NPC:74594"] = true,
				},
			},
			[32794] = {
				["reward_text"] = "For many years I hunted all sorts of prey alongside my father. This hunt shall honor his memory as well as avenge his death at the hands of these traitorous, honorless Thunderlords.",
				["can_share"] = true,
				["end"] = {
					["NPC:70941"] = true,
				},
			},
			[34451] = {
				["reward_text"] = "There is still much to be done before we can leave Auchindoun with peace of mind, champion.",
				["end"] = {
					["NPC:75246"] = true,
				},
			},
			[37264] = {
				["reward_text"] = "<name>, you've done a great service. If not for you, all of Draenor may have withered under High Sage Viryx's rule.",
				["end"] = {
					["NPC:88161"] = true,
				},
			},
			[35487] = {
				["reward_text"] = "That was stinky.",
				["end"] = {
					["NPC:82274"] = true,
				},
			},
			[36260] = {
				["reward_text"] = "Yes... This is it, after so many years. Soon, I will have all of the Armaments of Oru'kai.\r\n\r\nReturn my ring as well and I will fulfill the promise I made to that squeamish orc. \r\n\r\nTake this book. If you have any skill, you can use it to decipher and learn Draenor's enchantments. \r\n\r\nOf course, you will need a proper workplace as well. Here are plans; hopefully you can follow them.\r\n\r\nNow, be gone, and steer clear of the other armaments, for they are mine.",
				["progress_text"] = "Do you have it? Give it to me.",
				["end"] = {
					["NPC:84739"] = true,
				},
			},
			[33973] = {
				["reward_text"] = "Thank you. Now that I know it is out of the hands of the Iron Horde, I can die peacefully.",
				["progress_text"] = "The Blademaster must pay...",
				["end"] = {
					["NPC:77031"] = true,
				},
			},
			[35511] = {
				["reward_text"] = "Commander, you go where you will and kill any who would stand in your way.\n\nI find this fun.\n\nI wish to join your... \"followers\"... as the lady wolf keeps calling them.\n\nMy home is crushed, my family mulched, and this place has lost its charm.\n\nLet me join you.",
				["end"] = {
					["NPC:82338"] = true,
				},
			},
			[33734] = {
				["reward_text"] = "Thank you.",
				["can_share"] = true,
				["progress_text"] = "These are more than mere objects. They are our livelihood, our past and future, our comfort.\n\nThey are pieces of us.",
				["end"] = {
					["NPC:75913"] = true,
				},
			},
			[35272] = {
				["reward_text"] = "Thank da spirits you showed up. Dey hear my prayers.",
				["can_share"] = true,
				["end"] = {
					["NPC:81890"] = true,
				},
			},
			[34041] = {
			},
			[32993] = {
				["reward_text"] = "Help me out of these chains. We have work to do.",
				["can_share"] = true,
				["end"] = {
					["NPC:72373"] = true,
				},
			},
			[34348] = {
				["reward_text"] = "Now dat be a mighty fine haul. We gonna be keepin' all the folks at the garrison warm.\n\nIt seemed like a simple task but ya tackled it like a boss-mon. If ya need a shadow hunter in your ranks, I be willin' to serve.",
				["can_share"] = true,
				["end"] = {
					["NPC:78208"] = true,
				},
			},
			[35671] = {
				["reward_text"] = "We owe you a great debt for delivering Reshad safely to us, <name>.\n\nHowever, our struggle has only just begun.",
				["can_share"] = true,
				["end"] = {
					["NPC:82720"] = true,
				},
			},
			[36567] = {
				["reward_text"] = "Now THAT'S what I'm talkin' about! Look at this place!\r\n\r\nWe've even <name> a pool out back. Little cold, sure, but ya can't always have a tropical paradise.",
				["end"] = {
					["NPC:78466"] = true,
				},
			},
			[33754] = {
				["reward_text"] = "Orgrim leads these orcs? Why has he pledged himself to the Iron Horde?",
				["progress_text"] = "Take a look through Gazlowe's Eye 'n' Ear.",
				["end"] = {
					["NPC:75806"] = true,
				},
			},
			[33543] = {
				["reward_text"] = "Ha! Curious. What are you?",
				["end"] = {
					["NPC:84176"] = true,
				},
			},
			[37571] = {
				["reward_text"] = "Let me unpack that for you.\n\nI should let you know - while we managed to expedite this one, future work orders will take longer.",
				["progress_text"] = "Yes?",
				["end"] = {
					["NPC:86696"] = true,
				},
			},
			[34579] = {
				["reward_text"] = "Thank you boss, this is just what I needed.\n\nBy the way, Goren gas is rather difficult to come by. We should probably hold off on clearing those guys out till we can stockpile enough.\n\nJust a thought.",
				["end"] = {
					["NPC:79356"] = true,
				},
			},
			[37563] = {
				["reward_text"] = "Excellent choice. I will be sad to see them leave, but I know they will help strengthen our combined packs in the coming conflicts.\n\nI will see that they make their way to your garrison as soon as they have said farewell to their loved ones.\n\nThey should be ready the next time you need to send followers on a mission.",
				["can_share"] = true,
				["end"] = {
					["NPC:76730"] = true,
				},
			},
			[34659] = {
				["reward_text"] = "I will point you in the right direction, but I cannot guarantee you'll survive the trip.\n\nKah-hah haha!",
				["can_share"] = true,
				["end"] = {
					["NPC:79890"] = true,
				},
			},
			[34858] = {
				["reward_text"] = "Thank you, commander. With this another stain on my honor has been removed.",
				["can_share"] = true,
				["progress_text"] = "Were you able to get all of my blades back?",
				["end"] = {
					["NPC:80341"] = true,
				},
			},
			[33722] = {
				["reward_text"] = "We will have fewer enemies to deal with at our backs. Lok'tar.",
				["can_share"] = true,
				["end"] = {
					["NPC:75958"] = true,
				},
			},
			[33918] = {
				["reward_text"] = "Very good. We don't be needin' a gronn bearin' down on us before we get our defenses all established.",
				["can_share"] = true,
				["end"] = {
					["NPC:78487"] = true,
				},
			},
			[36256] = {
				["reward_text"] = "Do I also detect that you have in your possession an artifact of our land? \r\n\r\nCan I see it?\r\n\r\nOne of Oru'kai's bracers... Thank you!",
				["progress_text"] = "Greetings Enchanter. I can see you are acquainted with the art. \r\n\r\nGood, good. Perhaps you and I can help each other.",
				["end"] = {
					["NPC:84739"] = true,
				},
			},
			[35400] = {
				["reward_text"] = "These creatures... were not what I expected to see. I always knew Gorgrond to be a dangerous place, but I never could have guessed at how vile.\n\nThank you, commander, for your compassion in this.",
				["end"] = {
					["NPC:74593"] = true,
				},
			},
			[35408] = {
				["reward_text"] = "Good job, soldier.",
				["can_share"] = true,
				["progress_text"] = "I hope you're toting a cannon and some balls, soldier.",
				["end"] = {
					["NPC:82212"] = true,
				},
			},
			[37456] = {
				["reward_text"] = "Feeling safe, stranger?",
				["progress_text"] = "Twice the cost of the last, but maybe that's worth the price. Or, perhaps a different currency would be more efficient for you?  I leave the choice up to you.\r\n\r\nRemember, you can only obtain three seals per week.  This counts as one of those three.  Next week, I may have others.",
				["end"] = {
					["NPC:88570"] = true,
				},
			},
			[34404] = {
				["reward_text"] = "The crystals in this mine are most certainly unique. Thorough study of the samples you have provided should reveal why this is the case.",
				["can_share"] = true,
				["progress_text"] = "Have you collected the unrefined power crystals I need for my research?",
				["end"] = {
					["NPC:78515"] = true,
				},
			},
			[35432] = {
				["reward_text"] = "I had thought the Laughing Skull were planning something. Now I think I am beginning to understand.\n\nThey match savagery with savagery.",
				["can_share"] = true,
				["end"] = {
					["NPC:82233"] = true,
				},
			},
			[36205] = {
			},
			[33663] = {
				["reward_text"] = "Good work, but we need to move quickly before the plants realize the way is open...",
				["end"] = {
					["NPC:82222"] = true,
				},
			},
			[33724] = {
				["reward_text"] = "Lots of detail... almost as if a goblin wrote it!",
				["progress_text"] = "I don't know why those idiots don't just collect all the pages in one place.",
				["end"] = {
					["NPC:75941"] = true,
				},
			},
			[36460] = {
				["reward_text"] = "Perhaps this little creature will earn her keep after all.",
				["end"] = {
					["NPC:74594"] = true,
				},
			},
			[34962] = {
				["reward_text"] = "You have done great work with Durotan, Draka, and Gazlowe.",
				["end"] = {
					["NPC:75805"] = true,
				},
			},
			[33695] = {
				["reward_text"] = "You have... you have brought me the bloom. At last my purpose can be fulfilled!",
				["can_share"] = true,
				["progress_text"] = "Do you have something for me, little beast?",
				["end"] = {
					["NPC:82302"] = true,
				},
			},
			[35998] = {
				["can_share"] = true,
			},
			[34731] = {
				["reward_text"] = "My sista have other duties, but I have leave of ol' Vol'jin to extend my services to you.\n\nYa proved your worth, and did a task that needed doing.\n\nI be followin' ya, boss-mon, if ya be willing.",
				["end"] = {
					["NPC:78208"] = true,
				},
			},
			[35249] = {
				["reward_text"] = "You look like you can fight. We need to get out of here!",
				["end"] = {
					["NPC:77737"] = true,
				},
			},
			[35527] = {
				["reward_text"] = "Big baddy botani busted? Works for me!",
				["can_share"] = true,
				["end"] = {
					["NPC:82574"] = true,
				},
			},
			[33735] = {
				["reward_text"] = "I believe we can use these at Archenon Siegeyard.",
				["progress_text"] = "Have you found the Iron Horde Explosives yet?",
				["end"] = {
					["NPC:75808"] = true,
				},
			},
			[32792] = {
				["reward_text"] = "Hrmph. The burning smell of Thunderlord. This pleases me, <class>.",
				["can_share"] = true,
				["progress_text"] = " ",
				["end"] = {
					["NPC:70910"] = true,
				},
			},
			[35536] = {
				["reward_text"] = "You found my Cutter! I shall gladly cut a thousand throats in your honor.",
				["end"] = {
					["NPC:82228"] = true,
				},
			},
			[32994] = {
				["reward_text"] = "See how their machines fail them! There is no better weapon than pure orc muscle!",
				["can_share"] = true,
				["progress_text"] = "If we leave those cannons intact, my brothers and sisters will die. What more is there to say?",
				["end"] = {
					["NPC:73097"] = true,
				},
			},
			[35031] = {
				["reward_text"] = "We are so close I can almost touch it!  We will have to go deeper, much deeper!",
				["can_share"] = true,
				["end"] = {
					["NPC:81241"] = true,
				},
			},
			[33010] = {
				["reward_text"] = "Thank you for protecting my family, <name>.",
				["can_share"] = true,
				["end"] = {
					["NPC:76720"] = true,
				},
			},
			[34803] = {
				["reward_text"] = "For <name>! For the Horde!",
				["end"] = {
					["NPC:79921"] = true,
				},
			},
			[33807] = {
				["reward_text"] = "The Frostwolf clan cannot be held like beasts.\n\nYou fight with honor, <name>.",
				["can_share"] = true,
				["end"] = {
					["NPC:74651"] = true,
				},
			},
			[33544] = {
				["reward_text"] = "Ripfist's dying wish has been satisfied. Goren corpses litter the ground, and these corpses have not gone unnoticed by the nearby goren.",
				["end"] = {
					["PLAYER:0"] = true,
				},
			},
			[34827] = {
				["can_share"] = true,
			},
			[32795] = {
				["reward_text"] = "Today is a good day.",
				["can_share"] = true,
				["end"] = {
					["NPC:70941"] = true,
				},
			},
			[35353] = {
				["reward_text"] = "I will convince the others of our fate. There's no denying it anymore.",
				["can_share"] = true,
				["progress_text"] = "Is the creature dead?",
				["end"] = {
					["NPC:82126"] = true,
				},
			},
			[35151] = {
				["reward_text"] = "A fine choice. It will need more work before such a structure could be built in your garrison, but this is a start.",
				["can_share"] = true,
				["end"] = {
					["NPC:74594"] = true,
				},
			},
			[36054] = {
				["reward_text"] = "A simple exchange with complex results.  That's the art of doing business.",
				["progress_text"] = "Gold is indeed treasure, but additional treasure for gold?  That's the offer I present.  A Seal of Twisted Fate twists time, providing a burst of additional luck just when you need it.\r\n\r\nRemember, you can only obtain three Seals of Twisted Fate per week.  This counts as one of those three.  Next week, I may have others.",
				["end"] = {
					["NPC:88570"] = true,
				},
			},
			[34102] = {
				["reward_text"] = "Good work,<name>!\n\nSeeing Frostwolf banners standing proudly over our crushed foes fills me with pride!\n\nLet them forever fear the wrath of the Frostwolves!",
				["can_share"] = true,
				["end"] = {
					["NPC:77210"] = true,
				},
			},
			[32989] = {
				["reward_text"] = "<name>! They told me you'd be heading this way. You are late to the party! We are just cleaning up now.",
				["can_share"] = true,
				["end"] = {
					["NPC:72274"] = true,
				},
			},
			[36158] = {
				["can_share"] = true,
			},
			[35146] = {
				["can_share"] = true,
			},
			[35154] = {
				["reward_text"] = "Nice job, <name>! Let's get this mining operation started!",
				["end"] = {
					["NPC:81688"] = true,
				},
			},
			[35672] = {
				["can_share"] = true,
			},
			[35507] = {
				["reward_text"] = "Goren, goren, gone!",
				["end"] = {
					["NPC:82334"] = true,
				},
			},
			[35433] = {
				["reward_text"] = "They are lucky you are the one that killed them. I would have tried to carve pictures in their dead wood bodies.",
				["can_share"] = true,
				["end"] = {
					["NPC:82233"] = true,
				},
			},
			[33119] = {
				["reward_text"] = "Who are you, outsider? I saw you freeing some of my kin...",
				["can_share"] = true,
				["end"] = {
					["NPC:72890"] = true,
				},
			},
			[33919] = {
				["can_share"] = true,
			},
			[33468] = {
				["reward_text"] = "Durotan's trust in you is well-placed, <name>. You have mine as well.",
				["end"] = {
					["NPC:74651"] = true,
				},
			},
			[37290] = {
				["reward_text"] = "Oh YEAH buddy! We can work something out. I <name> plenty of stuff for you to buy!",
				["end"] = {
					["NPC:85840"] = true,
				},
			},
			[33473] = {
				["reward_text"] = "Grim news indeed, <name>.\n\nFor saving Wolf Home, I would name you wolf-brother.\n\nNow we must defend Frostfire Ridge from the Thunderlord clan and the Iron Horde.",
				["can_share"] = true,
				["end"] = {
					["NPC:70860"] = true,
				},
			},
			[34971] = {
				["reward_text"] = "The outpost is now fully up and running and we have enough material to outfit an army - your army!",
				["end"] = {
					["NPC:80623"] = true,
				},
			},
			[36812] = {
				["reward_text"] = "You're good people, commander.",
				["end"] = {
					["NPC:85077"] = true,
				},
			},
			[34732] = {
				["reward_text"] = "Well, hero, I owe you both my life and my honor. I ask that you allow me to repay this debt by serving under your command.\n\nYou will find that I am a fearsome hunter. I have also mastered the art of riding the rylaks, which few among the Frostwolves can claim.\n\nWill you accept my service?",
				["end"] = {
					["NPC:79047"] = true,
				},
			},
			[35505] = {
				["reward_text"] = "Frenna didn't make it out of Tangleheart.",
				["can_share"] = true,
				["end"] = {
					["NPC:82569"] = true,
				},
			},
			[33728] = {
				["reward_text"] = "Orgrim seems to be up to no good.",
				["end"] = {
					["NPC:75941"] = true,
				},
			},
			[34756] = {
				["reward_text"] = "How very noble of you to act as bait on my behalf. I will not forget this.",
				["can_share"] = true,
				["end"] = {
					["NPC:81770"] = true,
				},
			},
			[35537] = {
				["reward_text"] = "Welcome back, boss-mon.\r\n\r\nI know you'll probably be wantin' to get things settled here first, but there's been some word of an uprisin' in Spires of Arak. There might be some allies to be made if we get involved.\r\n\r\nThought ya might want to know.",
				["can_share"] = true,
				["end"] = {
					["NPC:78487"] = true,
				},
			},
			[35027] = {
				["reward_text"] = "You take too long. Something calls to us deeper in there. Whatever it is, I will have its skull or die trying.",
				["can_share"] = true,
				["end"] = {
					["NPC:80757"] = true,
				},
			},
			[36055] = {
				["progress_text"] = "You seem like the type who is always seeking power, no? These seals provide an investment, if you will, in your future power.\r\n\r\nI also seek power, but one that is a more immediate and tangible. If you manage to find some crystals, we can make a deal. \r\n\r\nRemember, you can only obtain three seals per week.  This counts as one of those three.  Next week, I may have others.",
			},
			[34040] = {
			},
			[34837] = {
				["reward_text"] = "I crafted a few things before we left that we may need: some bombs, a grappling hook, even was able to get one of the goblins to get a spare rocket pack.\n\nI'm sure we'll find a use for everything.",
				["can_share"] = true,
				["end"] = {
					["NPC:80229"] = true,
				},
			},
			[34653] = {
				["reward_text"] = "<The arakkoa merchant looks you up and down.>\n\nWell-equipped, aren't we? Azik is betting you are someone of importance to your people.\n\nCome closer, friend. Speak with me for just a moment.",
				["can_share"] = true,
				["end"] = {
					["NPC:79539"] = true,
				},
			},
			[35322] = {
				["reward_text"] = "Thank you, friend.",
				["can_share"] = true,
				["progress_text"] = "I'd recognize one of my schematics anywhere.",
				["end"] = {
					["NPC:82100"] = true,
				},
			},
			[34805] = {
				["reward_text"] = "Blasted things. Nothing more than flying rats if you ask me!",
				["can_share"] = true,
				["end"] = {
					["NPC:81770"] = true,
				},
			},
			[35506] = {
				["reward_text"] = "You <name> it! You should be able to use this mole machine one way back to your outpost.",
				["can_share"] = true,
				["progress_text"] = "Don't be such a sap. Get it?!",
				["end"] = {
					["NPC:82574"] = true,
				},
			},
			[32796] = {
				["reward_text"] = "Ga'nar is coming. Good. We need his forces if we are to press the advantage.\n\nI can only hope his bloodlust has quelled enough for him to listen to reason.",
				["can_share"] = true,
				["end"] = {
					["NPC:74163"] = true,
				},
			},
			[32804] = {
				["reward_text"] = "You have shown honor to our clan. This act shall be remembered.",
				["can_share"] = true,
				["progress_text"] = "Have you found the articles?",
				["end"] = {
					["NPC:74223"] = true,
				},
			},
			[33785] = {
				["reward_text"] = "<Karg scoops up a handful of snow and cleans the gore from his axe.>\n\nYou fight well.",
				["can_share"] = true,
				["end"] = {
					["NPC:73097"] = true,
				},
			},
			[34860] = {
				["reward_text"] = "Alright, that should be the last one we need. \n\nNothing feels as good as knowing you are stronger than your enemy!",
				["end"] = {
					["NPC:80341"] = true,
				},
			},
			[33593] = {
				["reward_text"] = "That didn't seem to do much, commander, except to give away our position to every creature in Gorgrond.\n\nWait, did you hear something?",
				["end"] = {
					["NPC:74594"] = true,
				},
			},
			[34964] = {
				["can_share"] = true,
			},
			[34884] = {
				["can_share"] = true,
			},
			[35402] = {
				["reward_text"] = "It isn't enough to kill the botani. They will always have greater numbers.\n\nYou must cut them deep and hard, where it hurts them the most.\n\nLike slaying their most sacred leader.",
				["end"] = {
					["NPC:74606"] = true,
				},
			},
			[34279] = {
				["reward_text"] = "Blook never beat before.\n\nBlook follow tiny person now, so Blook learn how to beat more people.",
				["end"] = {
					["NPC:78030"] = true,
				},
			},
			[36183] = {
				["reward_text"] = "From one commander to another... thank you.\n\nWe've faced off on the field of battle so many times. Vashj'ir... the Jade Forest... Lion's Landing...\n\nI am glad I could end my journey with such a worthy adversary.",
				["can_share"] = true,
				["end"] = {
					["NPC:82375"] = true,
				},
			},
			[33761] = {
				["reward_text"] = "My notes! In the chaos, I completely for<name> about them!\n\nThis is my life's work, <name>. I cannot thank you enough.",
				["progress_text"] = "Hm, what is that book you have there?",
				["end"] = {
					["NPC:75913"] = true,
				},
			},
			[35434] = {
				["reward_text"] = "The Waters of Utrophis. I have never held or smelled or tasted it before. But I have heard many stories, many legends.\n\nI was expecting something more grand.",
				["progress_text"] = "For years the Laughing Skull would not touch the sacred waters. We feared the wrath of the botani. We should have set them to burn long ago.",
				["end"] = {
					["NPC:82228"] = true,
				},
			},
			[35697] = {
				["can_share"] = true,
			},
			[33920] = {
				["reward_text"] = "<Soulbinder Nyami's lips curl into a smile.>\n\nWell done. Only two pieces remain. I've already dispatched my soulbinders to track them down.",
				["progress_text"] = "I trust you have Karab'uun. I am not known for my patience when the countless souls inside Auchindoun are in danger.",
				["end"] = {
					["NPC:78519"] = true,
				},
			},
			[34948] = {
				["reward_text"] = "These orders appear to have come from Orgrim Doomhammer.",
				["end"] = {
					["OBJECT:225726"] = true,
				},
			},
			[33721] = {
				["reward_text"] = "I always love a good explosion.",
				["end"] = {
					["NPC:75924"] = true,
				},
			},
			[33689] = {
				["reward_text"] = "They just keep coming back! I would hate to lose this hunting ground. We shall find a way to clear this growth, I swear it.",
				["end"] = {
					["NPC:85089"] = true,
				},
			},
			[34972] = {
				["reward_text"] = "It took a lot of hard work but we have made a beautiful arsenal here.\n\nSir, I've been able to outfit your soldiers here with new equipment but I'd like to do more.\n\nI'd be deeply honored if you would let me work for you in your main garrison.",
				["end"] = {
					["NPC:80623"] = true,
				},
			},
			[33450] = {
				["reward_text"] = "You have done well in this, but do not become proud. This land has dangers far greater than what you have seen here.",
				["progress_text"] = "You still draw breath, hmm?\n\nHave you dealt with the warlord's underlings?",
				["can_share"] = true,
				["end"] = {
					["NPC:74635"] = true,
				},
			},
			[37570] = {
				["reward_text"] = "Let me unpack that for you.\n\nI should let you know - while we managed to expedite this one, future work orders will take longer.",
				["progress_text"] = "Yes?",
				["end"] = {
					["NPC:79820"] = true,
				},
			},
			[37291] = {
				["reward_text"] = "Well fought, commander. Now to strike back before the Thunderlord can recover.",
				["end"] = {
					["NPC:88228"] = true,
				},
			},
			[33729] = {
				["reward_text"] = "-- ENEMIES ELIMINATED --",
				["end"] = {
					["NPC:75968"] = true,
				},
			},
			[33720] = {
				["reward_text"] = "A prototype Iron Shredder, huh?! I bet we can get this thing working... they didn't have ME to fix it!",
				["can_share"] = true,
				["end"] = {
					["NPC:75924"] = true,
				},
			},
			[35275] = {
				["reward_text"] = "Our lives for your will, commander.",
				["can_share"] = true,
				["end"] = {
					["NPC:81913"] = true,
				},
			},
			[36494] = {
				["reward_text"] = "Welcome back, mon.",
				["end"] = {
					["NPC:78487"] = true,
				},
			},
			[36056] = {
				["reward_text"] = "Feeling safe, stranger?",
				["progress_text"] = "That extravagant fortification you built is impressive. Tell me, does it keep all the bad things away? Yes?  How about an exchange for a bit of fate? A wall can be thick enough, but one is never lucky enough. Besides, safety can be so overpriced...\r\n\r\nRemember, you can only obtain three seals per week.  This counts as one of those three.  Next week, I may have others.",
				["end"] = {
					["NPC:88570"] = true,
				},
			},
			[36574] = {
				["can_share"] = true,
			},
			[34414] = {
				["reward_text"] = "Excellent. Give me a moment and I will prepare the focusing crystal.",
				["can_share"] = true,
				["progress_text"] = "Do you have the crystal giant heart?",
				["end"] = {
					["NPC:78515"] = true,
				},
			},
			[33530] = {
				["reward_text"] = "If this Teron'gor gains control of Auchindoun, the results would be catastrophic!\n\nWe must stop him before his power grows!",
				["end"] = {
					["NPC:75121"] = true,
				},
			},
			[35928] = {
				["progress_text"] = "I have plenty of meat. You should buy some.\n\nWhat I really need are bones. Nagrand's animals are the heartiest on all of Draenor. They have the finest-quality bones.\n\nI'm making the tastiest soup you've ever tried. I'll show that Grogglefitz who the best cook truly is.",
			},
			[34566] = {
				["reward_text"] = "Your will be done.\n\nFor the Horde!",
				["progress_text"] = "What is your will, commander?",
				["end"] = {
					["NPC:79176"] = true,
				},
			},
			[35339] = {
				["reward_text"] = "We're... dead?",
				["can_share"] = true,
				["progress_text"] = "Everything is so hazy... what happened? Who are you?",
				["end"] = {
					["NPC:82124"] = true,
				},
			},
			[34072] = {
				["reward_text"] = "Ugh, those smell awful! No, I don't need to see them. I'll take you at your word that you have them all.\n\nLet's get a move on before another Thunderlord patrol stumbles upon me.",
				["can_share"] = true,
				["progress_text"] = "We need that tar soon <name>! Get to it!",
				["end"] = {
					["NPC:77210"] = true,
				},
			},
			[35100] = {
				["can_share"] = true,
			},
			[33578] = {
				["reward_text"] = "You killed him? Oh, oh thank you!\n\nBut what was that he said about an artifact?",
				["end"] = {
					["NPC:75311"] = true,
				},
			},
			[34351] = {
				["reward_text"] = "Light bless you, hero! We need to hold out as long as we can so Nyami can track down the remaining power shards. This pylon will help take the load off of our soulpriests.",
				["progress_text"] = "Do you have the arkonite pylon and the crystals?",
				["end"] = {
					["NPC:78520"] = true,
				},
			},
			[33736] = {
				["reward_text"] = "It is a relief to know that their weapons of war cannot be used against us.",
				["end"] = {
					["NPC:75808"] = true,
				},
			},
			[35226] = {
				["reward_text"] = "Orgrim will not stop this foolishness, so we must stop him.",
				["can_share"] = true,
				["end"] = {
					["NPC:75958"] = true,
				},
			},
			[33548] = {
				["reward_text"] = "These are more than fancy facewear. With a mask and some proper incentive, we can make anyone a Laughing Skull.",
				["progress_text"] = "We are the Laughing Skull! We do not flinch in the face of death. We laugh at it.",
				["end"] = {
					["NPC:74606"] = true,
				},
			},
			[34766] = {
				["reward_text"] = "I never doubted you for a moment. You are truly a commander of the people.\n\nLok'tar ogar!",
				["can_share"] = true,
				["progress_text"] = "Commander! Have you had time to locate our supplies and ledgers?",
				["end"] = {
					["NPC:79921"] = true,
				},
			},
			[35501] = {
				["reward_text"] = "The rounds of doomshot fit into the weapon loader with ease.",
				["can_share"] = true,
				["progress_text"] = "This loader can take a number of rounds of doomshot at a time.",
				["end"] = {
					["OBJECT:232489"] = true,
				},
			},
			[34399] = {
				["reward_text"] = "The Vindicators welcome you, <name>.",
				["end"] = {
					["NPC:78538"] = true,
				},
			},
			[34069] = {
				["reward_text"] = "Hrm, yes these spears look pretty good.\n\nNot bad! I know just what to use these for!",
				["progress_text"] = "What is it <class>? Have you <name> something for me?",
				["can_share"] = true,
				["end"] = {
					["NPC:77210"] = true,
				},
			},
			[35029] = {
				["reward_text"] = "Yes, they smell... wonderful. These will help me find the power of this marsh and take it for my own.",
				["progress_text"] = "Where are my mushrooms?!",
				["end"] = {
					["NPC:80757"] = true,
				},
			},
			[34070] = {
				["reward_text"] = "Well done <name>! The removal of the Sky Riders takes the heat off us for a bit. Keep your weapon in hand though, we're not done with them yet.",
				["can_share"] = true,
				["end"] = {
					["NPC:77210"] = true,
				},
			},
			[33581] = {
				["reward_text"] = "Yes, yes. Excellent work, these are some of my favorites.\n\nKnowledge is power, and now I can leave for the spires feeling well-armed.",
				["can_share"] = true,
				["progress_text"] = "What kind of sick individual burns a book full of perfectly good dark arts?!",
				["end"] = {
					["NPC:75323"] = true,
				},
			},
			[33929] = {
				["reward_text"] = "Shivertail snuggles up to his mother. He is clearly happy to be reunited with most of his pack.",
				["can_share"] = true,
				["end"] = {
					["NPC:76889"] = true,
				},
			},
			[34447] = {
				["reward_text"] = "A wise elder of my order once told me, \"True power is the strength to act and the wisdom to know when not to act.\" May those words and the memory of Kaelynara stay with you on your journey, <name>.",
				["end"] = {
					["NPC:78538"] = true,
				},
			},
			[34710] = {
				["reward_text"] = "Aeun sent you? Help has arrived!",
				["can_share"] = true,
				["end"] = {
					["NPC:78534"] = true,
				},
			},
			[32929] = {
				["reward_text"] = "A fine headcount, commander.",
				["can_share"] = true,
				["end"] = {
					["NPC:74223"] = true,
				},
			},
			[33706] = {
				["reward_text"] = "At last it is done.  Dionor has left and his spawn shall follow him in due time.\n\nI grow weary of this conflict and the desire to return to the Overgrowth has left me.\n\nPerhaps I will travel beyond these lands and see what other surprises you little beasts have to share...",
				["end"] = {
					["NPC:82302"] = true,
				},
			},
			[34683] = {
				["reward_text"] = "Ah, <name>. I recognized your scent, friend. We have been waiting for your arrival to begin our task.",
				["can_share"] = true,
				["end"] = {
					["NPC:75806"] = true,
				},
			},
			[33467] = {
				["reward_text"] = "Impressive work.",
				["can_share"] = true,
				["end"] = {
					["NPC:81678"] = true,
				},
			},
			[33730] = {
				["reward_text"] = "Gazlowe has been invaluable in securing Talador. Now, it is up to us.",
				["end"] = {
					["NPC:75959"] = true,
				},
			},
			[33483] = {
				["reward_text"] = "You have my sincere gratitude, <name>.",
				["can_share"] = true,
				["progress_text"] = "These ogres will be seeing the other side of my axes soon.",
				["end"] = {
					["NPC:79047"] = true,
				},
			},
			[35021] = {
				["reward_text"] = "What's this?  Let me check if it has a skull...",
				["can_share"] = true,
				["end"] = {
					["NPC:80757"] = true,
				},
			},
			[34774] = {
				["reward_text"] = "You will accept this gift, and you will like it.  To do otherwise will automatically engage my organic incineration weapons.  Thank you.",
				["end"] = {
					["NPC:77789"] = true,
				},
			},
			[36057] = {
				["progress_text"] = "To kill another for honor is peculiar...a relic of an older time, perhaps?  No matter, this seal is of no use to me.  It is far too burdened with power for me to control.\r\n\r\nRemember, you can only collect three seals per week.  This counts as one of those three.  Next week, I may have others.",
			},
			[29444] = {
			},
			[33013] = {
				["reward_text"] = "<Thunderlord apprentices toil under the watchful eye of Blackrock orcs.\n\nUsing lava pools as natural forges, they craft components for a type of weapon never before seen by the Frostwolves: cannons.>",
				["can_share"] = true,
				["end"] = {
					["PLAYER:0"] = true,
				},
			},
			[259] = {
				["can_share"] = true,
			},
			[36699] = {
				["begin"] = {
					["PLAYER:0"] = true,
				},
				["races"] = {
					["Orc"] = true,
				},
				["end"] = {
					["NPC:78495"] = true,
				},
				["reward_text"] = "News about da assault beat ya back, boss-mon. And some spoils of the fightin'.\n\nYa be a f<race>e to be reckonin' with.",
				["classes"] = {
					["WARRIOR"] = true,
				},
			},
			[36862] = {
				["can_share"] = true,
			},
			[35997] = {
				["can_share"] = true,
			},
			[33563] = {
				["reward_text"] = "These puppets of the magnaron will pay for the skulls they claimed today.\n\nFor now, I shall wear this eye across my waist so this fool you have slain may watch as I slowly slaughter his brethren until my dying breath.",
				["can_share"] = true,
				["progress_text"] = "Did you make that thing scream? Did it beg for mercy? Did you kill it before taking its eye? Tell me everything.",
				["end"] = {
					["NPC:74611"] = true,
				},
			},
			[33826] = {
				["reward_text"] = "Nerok and I are the only surviving prisoners, but we cannot leave just yet.",
				["can_share"] = true,
				["end"] = {
					["NPC:73097"] = true,
				},
			},
			[34344] = {
				["reward_text"] = "Dem centipedes creep you out boss-mon? Touchin' ya with their teeny tiny legs? I ain't thought of a thing that makes me skin crawl more, except maybe mah sister's voice. Hee hee.",
				["progress_text"] = "Dem lurkers scare ya off?",
				["can_share"] = true,
				["end"] = {
					["NPC:78208"] = true,
				},
			},
			[33694] = {
				["reward_text"] = "Marrow sent you? Our village destroyed? I would have been back already if it wasn't for these cursed plant beasts!",
				["can_share"] = true,
				["end"] = {
					["NPC:81731"] = true,
				},
			},
			[34870] = {
				["reward_text"] = "Fine work commander! Your combat skills are clearly second to none. I am honored to be your armorer!\n\nLet's get back to the outpost so we can take stock of our new inventory. I saved a few flares to call us in a ride back.",
				["progress_text"] = "Do you have my mace?",
				["end"] = {
					["NPC:80342"] = true,
				},
			},
			[32838] = {
			},
			[34576] = {
				["reward_text"] = "This won't be as good as some of the mixes we had back in the Blackrock foundries, but it will do.",
				["progress_text"] = "I'm going to need a lot of iridium dust to purify the metal to anywhere near my standards.",
				["end"] = {
					["NPC:79356"] = true,
				},
			},
			[35510] = {
				["reward_text"] = "It was an honor to fight by your side today, commander.",
				["end"] = {
					["NPC:82337"] = true,
				},
			},
			[35667] = {
				["reward_text"] = "Marrow sent you, eh? Well we leave when I'm done here.",
				["can_share"] = true,
				["end"] = {
					["NPC:81218"] = true,
				},
			},
			[34655] = {
				["reward_text"] = "Azik must have seen something in you. I will trust his judgment, for n-\n\n<Reshad is interrupted as a warm gust of wind surges through the hut.>\n\nOh dear... they've arrived.",
				["can_share"] = true,
				["end"] = {
					["NPC:79519"] = true,
				},
			},
			[33898] = {
				["reward_text"] = "You <name> the fire in you alright.",
				["can_share"] = true,
				["end"] = {
					["NPC:76662"] = true,
				},
			},
			[35550] = {
				["reward_text"] = "Ukambe gave me the report, commander. You truly are the champion of the Horde.",
				["end"] = {
					["NPC:81920"] = true,
				},
			},
			[34066] = {
				["reward_text"] = "You have done well, <class>.\n\nNow before we can continue our assault we need to look for any supplies in the area that could help our fight.",
				["can_share"] = true,
				["end"] = {
					["NPC:77210"] = true,
				},
			},
			[33412] = {
				["reward_text"] = "<Igrimar winces as you show her Durotan's orders.>\n\nDon't look at me like that... ungh... I've survived worse.",
				["can_share"] = true,
				["end"] = {
					["NPC:74635"] = true,
				},
			},
			[34950] = {
				["reward_text"] = "An infernal machine.",
				["can_share"] = true,
				["end"] = {
					["NPC:75959"] = true,
				},
			},
			[36488] = {
				["reward_text"] = "Wow. Those... \"dwarves\"... sure do know how to make both botani AND goren mad.",
				["end"] = {
					["NPC:85601"] = true,
				},
			},
			[35669] = {
				["can_share"] = true,
			},
			[34209] = {
				["can_share"] = true,
			},
			[36257] = {
				["reward_text"] = "Thank you. I thought I was going to be stuck here forever.",
				["end"] = {
					["NPC:84747"] = true,
				},
			},
			[33970] = {
				["can_share"] = true,
			},
			[35508] = {
				["reward_text"] = "Hey, nice job commander!",
				["can_share"] = true,
				["end"] = {
					["NPC:82574"] = true,
				},
			},
			[33731] = {
				["reward_text"] = "I cannot believe Orgrim is truly dead. Blackhand has carved a hole in my heart, and I intend to destroy him when the opportunity presents itself.",
				["end"] = {
					["NPC:79604"] = true,
				},
			},
			[33484] = {
				["reward_text"] = "You found Mulverick?\r\n\r\nIt shouldn't be long before those ogres clear out after you defeated their master.",
				["can_share"] = true,
				["end"] = {
					["NPC:78222"] = true,
				},
			},
			[37062] = {
				["reward_text"] = "You have learned one of my tricks of the trade, <name>.",
				["end"] = {
					["NPC:87121"] = true,
				},
			},
			[35030] = {
				["reward_text"] = "These will aid me greatly.  I must consume them and take their power.  We are close to the end <name>, I can feel it.",
				["progress_text"] = "I need more of those pods!  Many more!",
				["can_share"] = true,
				["end"] = {
					["NPC:81241"] = true,
				},
			},
			[34736] = {
				["reward_text"] = "Eh dere, boss-mon! Watch ya step. Da ground be cracklin' and breakin' everywhere.",
				["can_share"] = true,
				["end"] = {
					["NPC:78208"] = true,
				},
			},
			[36831] = {
			},
			[35636] = {
				["reward_text"] = "<Reshad presses the feather into the tome before sliding it into his robes.>\n\nWe have one more stop before the wayshrine...",
				["can_share"] = true,
				["progress_text"] = "Here, I'll take them both for safekeeping.",
				["end"] = {
					["NPC:82621"] = true,
